import React from "react";
import full_stack_certificate from "./images/certifications/1mac_certificate.pdf"
const Achievements = () => {
  return (
    <div className="achievements">
      <h1>Achievements</h1>
      <div className="certification">
        <h3>Google Cloud Certified Professional Cloud Architect</h3> 
        <iframe 
          title="GCP Certificate"
          width="600" 
          height="450"  
          src="gcp_certificate.pdf"
        ></iframe>       
      </div>    
      <div className="certification">
       { /* AWS certificate */ }
         <h3>AWS Certified Solutions Architect Associate</h3> 
         <iframe  
           title="AWS Certificate"
           width="600" 
           height="450"
           src="aws_certificate.pdf"
         ></iframe>       
      </div>      
      { /* More certifications */ }
    </div>  
  );     
};

export default Achievements;
